import React from 'react';
import './Home.css';

const Home = () => {
  return (
    <div className="home-container">
      <header className="navbar">
        <div className="logo">
          <img src="./assets/" alt="Logo" className="logo-image" /> {/* Replace with actual logo */}
          <span>ASK ME</span>
        </div>
        <div className="language-select">
          <button className="language-button">
            <span role="img" aria-label="globe">üåê</span> English <span>‚ñº</span>
          </button>
        </div>
      </header>

      <div className="hero-section">
        <div className="text-content">
          <h1>Want To Learn Coding?</h1>
          <p className="welcome-message">Welcome Folks.</p>
          <p className="subheading">Connect--Learn--Teach--Grow</p>
          <div className="email-form">
            <input type="email" placeholder="Email Address" className="email-input" />
            <button className="submit-button">Submit</button>
          </div>
        </div>
        <div className="image-content">
          <img src="profile.png" alt="Person" className="profile-image" /> {/* Replace with actual image */}
        </div>
      </div>
    </div>
  );
};

export default Home;
